import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // 1. Click on the first product card to open the details modal
    // Using a combination of class and position to select the first product
    const firstProductCard = page.locator('.product-card').first();
    await firstProductCard.waitFor({ state: 'visible', timeout: 5000 });
    await firstProductCard.click();
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_product_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_product_clicked.png'));

    // 2. Wait for the product detail modal to be visible
    const productModal = page.locator('#productModal');
    await productModal.waitFor({ state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_visible.png'));

    // 3. Click the "Add to Wish List" button inside the modal
    // Using getByRole for a user-facing selector
    const addToWishlistButton = page.getByRole('button', { name: 'Add to Wish List' });
    await addToWishlistButton.waitFor({ state: 'visible', timeout: 5000 });
    await addToWishlistButton.click();

    // 4. Wait for the success notification
    const successNotification = page.locator('.notification.success');
    await successNotification.waitFor({ state: 'visible', timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_wishlist_confirmation.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_wishlist_confirmation.png'));

    // 5. Extract data to verify the action
    const notificationText = await successNotification.textContent();
    const wishlistData = await page.evaluate(() => {
      return localStorage.getItem('amazonWishlist');
    });
    const parsedWishlist = JSON.parse(wishlistData);

    return {
      success: true,
      action: "Added a product to the wishlist",
      extractedData: {
        notification: notificationText,
        wishlistItemCount: parsedWishlist.length,
        firstItemTitle: parsedWishlist.length > 0 ? parsedWishlist[0].title : null
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on error
    const errorScreenshots = [];
    try {
        const errorScreenshotPath = path.join(screenshotsDir, 'error_screenshot.png');
        await page.screenshot({ path: errorScreenshotPath });
        errorScreenshots.push(errorScreenshotPath);
    } catch (e) {
        console.error("Failed to take error screenshot:", e);
    }

    return {
      success: false,
      action: "Failed to add product to wishlist",
      extractedData: {},
      screenshots: errorScreenshots,
      error: error.message
    };
  }
}
